package swa.manage.entity;import java.io.Serializable;import java.util.Date;/** * RoomRecord:会议室预定记录表 * Created by jinyan.cao on 2017-07-03 17:47:53 */public class RoomRecord implements Serializable {    private static final long serialVersionUID = 2638601471608719819L;    /**     * 自增主键     */    private Long id;    /**     * 预定日期     */    private Date date;    /**     * 预定时间段，如0代表00:00-00:30，1代表00:30-1:00     */    private Integer timePeriod;    /**     * 编码:layer-pid     */    private String encode;    /**     * 人员预定表中关联id     */    private Long staffRecordId;    /**     * 是否已取消：0-取消，1-未取消     */    private Integer isvalid;    /**     * 创建时间     */    private Date createTime;    /**     * 更新时间     */    private Date updateTime;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public Date getDate() {        return this.date;    }    public void setDate(Date date) {        this.date = date;    }    public Integer getTimePeriod() {        return this.timePeriod;    }    public void setTimePeriod(Integer timePeriod) {        this.timePeriod = timePeriod;    }    public String getEncode() {        return this.encode;    }    public void setEncode(String encode) {        this.encode = encode;    }    public Long getStaffRecordId() {        return this.staffRecordId;    }    public void setStaffRecordId(Long staffRecordId) {        this.staffRecordId = staffRecordId;    }    public Integer getIsvalid() {        return this.isvalid;    }    public void setIsvalid(Integer isvalid) {        this.isvalid = isvalid;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }}